class BlogPost {
  BlogPost({
      String? id, 
      String? title,
      String? size,
      dynamic subTitle, 
      String? photoUrl, 
      List<Restaurant>? restaurants,}){
    _id = id;
    _title = title;
    _subTitle = subTitle;
    _photoUrl = photoUrl;
    _restaurants = restaurants;
    _size = size;
}

  BlogPost.fromJson(dynamic json) {
    _id = json['Id'];
    _title = json['title'];
    _subTitle = json['subTitle'];
    _size = json['size'];
    _photoUrl = json['photo_url'];
    if (json['restaurants'] != null) {
      _restaurants = [];
      json['restaurants'].forEach((v) {
        _restaurants?.add(Restaurant.fromJson(v));
      });
    }
  }
  String? _id;
  String? _title;
  dynamic _subTitle;
  String? _photoUrl;
  String? _size;
  List<Restaurant>? _restaurants;

  String? get id => _id;
  String? get title => _title;
  dynamic get subTitle => _subTitle;
  String? get photoUrl => _photoUrl;
  String? get size => _size;
  List<Restaurant>? get restaurants => _restaurants;



}

